import React from 'react'
import './Navbar.css'
export const Navbar=()=>{
    return(
        <nav className="nav">
            <img src='pokeball.png' alt='' style={{width:'30px',height:'30px',transform:'translateY(20px) translateX(20px)'}}/>
            
            <img src='pokeball.png' alt=''style={{width:'30px',height:'30px',transform:'translateY(20px) translateX(-20px)'}}/>
        </nav>
    )
}//<h1 style={{textAlign:'center'}}>Pokedex</h1>
